import { Navbar, Nav, Container, NavDropdown } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";
const Navigation = () => {
  return (
    <>
      <Navbar collapseOnSelect expand="lg" bg="dark" variant="white">
        <Container>
          <Navbar.Brand href="/">Centre formation</Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="responsive-navbar-nav">
            <Nav className="me-auto mt-4 mb-4">
              <Nav.Link href="/" ml-5>
                Qui sommes nous
              </Nav.Link>
              <Nav.Link href="/">Nos formations</Nav.Link>
              <Nav.Link href="/">Blog</Nav.Link>
              <Nav.Link href="/">Nous contacter</Nav.Link>
            </Nav>
            <Nav>
              <Nav.Link href="/">Espace formateur</Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>
    </>
  );
};

export default Navigation;
